import photo from '../images/photo.png'

const Home = () => {
    return (
      <> 
        <div>
          <img src={photo} alt="" width="200" height="200"/>
        </div>

        <div>
          <p>Saad Aziz</p>
        </div>

        <div>
          <p>engineer   |   designer</p>
        </div>

      </>
    );
}

export default Home;
